//添加安全判断
export function safe(object){

   return isNotEmpty(object) ? object.toString() : '';

}

export function safeObj(obj) {
    return isNotEmpty(obj) ? obj : '';
}

/*明确知道需要判空的类型为数组的时候调用*/
export function safeArray(array) {
    return (isNotEmpty(array) && Object.prototype.toString.call(array) == '[object Array]' )? array  : []
}
/**
 * 安全int值转换
 * @param {*} number 待转换的潜在int值
 * @param {*} defaultValue 转换失败返回的默认值
 */
export function safeNumber(number,defaultValue=0){
    if (isEmpty(number) || isNaN(parseInt(number))) {
        if (isEmpty(defaultValue) || isNaN(parseInt(defaultValue))){
            return 0
        } else {
            return parseInt(defaultValue)
        }
    } else {
        return parseInt(number)
    }
}
/**
 * 安全Float值转换
 * @param {*} number 待转换的潜在float值
 * @param {*} defaultValue 转换失败返回的默认值
 */
export function safeFloatNumber(number,defaultValue=0.0){
    if (isEmpty(number) || isNaN(parseFloat(number))) {
        if (isEmpty(defaultValue) || isNaN(parseFloat(defaultValue))){
            return 0.0
        } else {
            return parseFloat(defaultValue)
        }
    } else {
        return parseFloat(number)
    }
}
