//抽取img链接
export function extractingImge(res) {
    let imagesArray = []
    analyticalObj(res,imagesArray)
    return imagesArray
}
function analyticalObj(res,imagesArray) {
    try {
        let type = Object.prototype.toString.call(res);
        if (type === '[object Object]') {
            analyticalMap(res,imagesArray);
        } else if (type === '[object Array]'){
            analyticalArray(res,imagesArray);
        } else if (type === '[object String]'){
            analyticalStr(res,imagesArray);
        }
    } catch (e) {
    } finally {}
}
function analyticalMap(object,imagesArray){
    try {
        for (let key of Object.keys(object)) {
            let value = object[key];
            analyticalObj(value,imagesArray)
        }
    } catch (e) {
    } finally {}
}
function analyticalArray(array,imagesArray){
    try {
        for (let i = 0 ; i < array.length ; i++){
            let object = array[i];
            analyticalObj(object,imagesArray)
        }
    } catch (e) {
    } finally {}
}
function analyticalStr(img,imagesArray){
    let isImage = contantImage(img);
    if (isImage && isArray(imagesArray)){
        imagesArray.push(img)
    }
}
function contantImage(string){
    const filterImage = [".JPEG",".jpeg",".JPG",".jpg",".png",".gif",".webp",".svg"]
    return filterImage.some(function(value){return string.includes(value)});
}
