//返回字符串(str)中字符(cha)第(num)次出现的下面
export function findIndexOf(str,cha,num){
    var x=str.indexOf(cha);
    for(var i=1;i<num;i++){
        x=str.indexOf(cha,x+1);
    }
    return x;
}

