//获取当前时间
export function formatDateTime() {

    let date = new Date();
    let y = date.getFullYear();
    let m = date.getMonth() + 1;
    m = m < 10 ? ('0' + m) : m;
    let d = date.getDate();
    d = d < 10 ? ('0' + d) : d;

    return y + '-' + m + '-' + d;
}

export function currentDate(){

    let date = new Date();
    let year = date.getFullYear();
    let month = date.getMonth()+1;
    let myDate = date.getDate();
    let hours =  date.getHours();
    let minutes = date.getMinutes();
    let seconds = date.getSeconds();
    let mseconds = date.getMilliseconds();

    let timestamp = year+'-'+month+'-'+myDate+' '+hours+':'+minutes+':'+seconds;

    return timestamp;
}
/**
 * "2021-02-28 00:00:00" 提取 年月日  2021separator02separator28
 * @param {*} dateStr 时间字符串
 * @param {*} separator 分割符  默认 空
 */
export function extractDateToYMD(dateStr,separator=''){
    if (isEmpty(dateStr)) {
        return ''
    }
    //部分浏览器内核对 YYYY-MM-DD 格式转换有误
    dateStr = dateStr.replace(/-/g,'/')
    let period_date = new Date(dateStr)
    if (!isValidDate(period_date)) {
        return ''
    }
    if (isEmpty(separator)) {
        separator = ''
    }
    return period_date.getFullYear() +separator+ dealDayStr(period_date.getMonth() + 1) +separator+ dealDayStr(period_date.getDate())
}
/**
 *
 * @param {*} day
 */
export function dealDayStr(day){
    if ( isEmpty(day) ||  isNaN(parseInt(day)) ) {
        return day
    }
    if ( parseInt(day) > 9 ) {
        return day
    }
    return '0'+day
}
/**
 * 判断是否是可用的Date
 *
 * 1、new Date('2020-09-09')返回的是正常的Date对象
 * 2、new Date('not date format string') 仍然能返回Date对象，但不是正常的，利用getTime返回为NaN特性判断
 * @param {*} date
 */
export function isValidDate(date) {
    return date instanceof Date && !isNaN(date.getTime())
}

