export function getFirstLetterPinYin(str){
        if(!str || /^ +$/g.test(str)) return '';
        let result = [];
        for(let i=0; i<str.length; i++)
        {
            let unicode = str.charCodeAt(i);
            let ch = str.charAt(i);
            if(unicode >= 19968 && unicode <= 40869)
            {
                ch = pinyin_dict_firstletter.all.charAt(unicode-19968);
            }
            result.push(ch);
        }
        return result.join('');
}


